INSERT INTO `schuldaten` VALUES ('2023-10-04','Gregor-Mendel-Gymnasium Amberg','OStD Zenger','OStRin Edl','Moritzstraße 1',92224,'Amberg','sabine.edl@gmg.amberg.de','Sehr geehrte Erziehungsberechtigte,<br><br>hiermit erhalten Sie den Link zur Registrierung für die Bestellung der Codes für die ebooks.<br> Bitte registrieren Sie sich und wählen Sie nach anschließender Anmeldung bei der GMG ebooks Lizenzplattform diejenigen ebooks, die wir in Ihrem Namen kostenpflichtig bestellen sollen.<br> Sie erhalten die Codes nach Abschluss der gemeinsamen Bestellung über die Lizenzplattform, von wo Sie die Codes auch herunterladen können.<br> Bei Fragen konsultieren Sie den Elternbrief, die Anleitungen der Bestellplattform oder schreiben Sie eine Nachricht über den Schulmanager an Sabine Edl. Beste Grüße, das Büchereiteam <br> Registrierung:');
